#! /usr/bin/env node

// Get arguments passed on command line
var userArgs = process.argv.slice(2);

var async = require('async');
const InjectionPoint = require('./models/injectionPoint');
const Facility = require('./models/facility');
const Satellite = require('./models/satellite');
const { Pipeline } = require('./models/pipeline');


var mongoose = require('mongoose');
var mongoDB = userArgs[0];
mongoose.connect(mongoDB, { useNewUrlParser: true, useUnifiedTopology: true });
mongoose.Promise = global.Promise;
var db = mongoose.connection;
db.on('error', console.error.bind(console, 'MongoDB connection error:'));

var pipelines = [];
var injectionpoints = [];
var facilities = [];
var satellites = [];


function pipelineCreate({ license, segment, substance, from, from_feature, to, to_feature, status, length, type, grade, outside_diameter, wall_thickness, material, mop, internal_protection, injection_points, satellite }, cb) {
  pipelinedetail = {
    license,
    segment,
    substance,
    from,
    from_feature,
    to,
    to_feature,
    status,
    length,
    type,
    grade,
    outside_diameter,
    wall_thickness,
    material,
    mop,
    internal_protection,
    injection_points,
    satellite
  }

  var pipeline = new Pipeline(pipelinedetail);
  pipeline.save(function (err) {
    if (err) {
      cb(err, null)
      return
    }
    console.log('New Pipeline: ' + pipeline);
    pipelines.push(pipeline)
    cb(null, pipeline)
  });
}


function injectionPointCreate({ source, oil, gas, water, first_production, last_production, first_injection, last_injection, pv_unit_id, pv_node_id }, cb) {
  injectionpointdetail = {
    source,
    oil,
    water,
    gas,
    first_production,
    last_production,
    first_injection,
    last_injection,
    pv_unit_id,
    pv_node_id
  }

  var injectionpoint = new InjectionPoint(injectionpointdetail);
  injectionpoint.save(function (err) {
    if (err) {
      cb(err, null)
      return
    }
    console.log('New Injection Point: ' + injectionpoint);
    injectionpoints.push(injectionpoint)
    cb(null, injectionpoint)
  });
}


function facilityCreate({ name }, cb) {
  facilitydetail = {
    name
  }

  var facility = new Facility(facilitydetail);
  facility.save(function (err) {
    if (err) {
      cb(err, null)
      return
    }
    console.log('New Facility: ' + facility);
    facilities.push(facility)
    cb(null, facility)
  });
}

function satelliteCreate({ name, facility }, cb) {
  satellitedetail = {
    name,
    facility
  }

  var satellite = new Satellite(satellitedetail);
  satellite.save(function (err) {
    if (err) {
      cb(err, null)
      return
    }
    console.log('New Satellite: ' + satellite);
    satellites.push(satellite)
    cb(null, satellite)
  });
}

function ipArray(...sources) {
  arr = [];
  sources.forEach(source => arr.push(
    injectionpoints.find(inj_pt => inj_pt.pv_unit_id === source.pv_unit_id && inj_pt.pv_node_id === source.pv_node_id)
  ));
  return arr;
}

function identifyFacility(name) {
  return facilities.find(facility => facility.name === name);
}
function identifySatellite(name) {
  return satellites.find(satellite => satellite.name === name);
}

